  true,\n\t\"url\": null,\n\t\"notes\": \"<p>CMS is pursuing a vision to improve the
  quality of health care by expanding the information available about quality of care
  and through direct incentives to reward the delivery of superior quality care. Through
  the Premier Hospital Quality Incentive Demonstration CMS aims to see a significant
  improvement in the quality of inpatient care by awarding bonus payments to hospitals
  for high quality in several clinical areas, and by reporting extensive quality data
  on the CMS web site.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
